// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/utils/Strings.sol";


contract Test {
    string public num = "50";

    function getNum() public returns (string memory) {
        int8 intNum = stringToInt8(num);
        intNum -= 1;
        // string memory n = int8ToString(intNum);

        int8 rem = intNum / 10;
        int8 quotient = intNum % 10;

        string memory aStr = toString(rem);
        string memory bStr = toString(quotient);

        string memory concatenated = string(abi.encodePacked(aStr, ".", bStr));
        num = concatenated;

        return concatenated;
    }

    function stringToInt8(string memory _str) public pure returns (int8) {
        bytes memory b = bytes(_str);
        uint256 numDigits = b.length; // Changed type to uint256
        int8 result = 0;
        int8 factor = 1; // Changed type to int8

        for (uint256 i = numDigits - 1; i >= 0; i--) { // Changed type to uint256
            uint8 digit = uint8(b[i]) - 48; // ASCII '0' starts at 48
            require(digit <= 9, "Invalid digit");
            result += int8(digit) * factor;
            factor *= 10;
        }

        return result;
    }

    function toString(int8 value) internal pure returns (string memory) {
        if (value == 0) {
            return "0";
        }
        int8 temp = value;
        uint8 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            buffer[--digits] = bytes1(uint8(48 + uint8(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }

    function getValueInWei() public view returns (uint256) {
        return block.timestamp + (4 * 1 minutes);
    }
}

